import React, { useState } from 'react'

export default function ContactUs() {
    const[inputs, setinputs] = useState("")
    return (
        <form>
          <label>Name:
            <input type="text" name='name' id="name" value={inputs.name || ""} onChange={(e) => setName(e.target.value)}/>
          </label><br/>
          <label>Contact:
            <input type="text" name='contact' id='contact' value={inputs.contact || ""} onChange={(e) => setName(e.target.value)}/>
          </label><br/>
          <label>
            <button type='submit' name='Contact'>Enter</button>
          </label>
        </form>
      )
}
